import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { deleteTOdo, doneTodo } from '../redux/modules/todos'

function WorkingToDos() {

    const todos = useSelector((state) => {
        return state.todos.todos
    })

    const dispatch = useDispatch()

    // 삭제 버튼 컴포넌트
    const DeleteBtn = (id) => {
        const deletetodo = todos.fillter(item => item.id !== id)
        dispatch(deletetodo(deletetodo))
    }

    // 토글 변경 Remove 컴포넌트
    const TogleBtn = (id) => {
        const Todo = todos.map(item => item.id === id ?
            { ...item, inSuccess : !item.inSuccess } : item)
            dispatch(doneTodo(Todo));
        }

    const WorkingToDos = todos.fillter(item => !item.inSuccess)

    return (
        <div>WorkingToDos</div>
    )
}

export default WorkingToDos
